import React from "react";
import MyCard from "../../components/MyCard/MyCard";
import {useHistory} from "react-router-dom";

function Home() {
    let history=useHistory();
    function navigateToMakeup(category)
    {
        history.push("/makeup/"+category);
    }
    return (
        <div className="container">
            <div className="row justify-content-center">
                <div className="col">
                    <MyCard title="Blush"
                            buttonOnClick={(e)=>navigateToMakeup("blush")}
                            imgCard="http://makeup-api.herokuapp.com/assets/blush-ff7992c3d7690d18a9b0224177cfbdedbc036497cf87c393ec01c6a2ef070258.svg"/>

                </div>
                <div className="col">
                    <MyCard title="Blush"
                            buttonOnClick={(e)=>navigateToMakeup("bronzer")}
                            imgCard="http://makeup-api.herokuapp.com/assets/blush-ff7992c3d7690d18a9b0224177cfbdedbc036497cf87c393ec01c6a2ef070258.svg"/>

                </div>
                <div className="col">
                    <MyCard title="Blush"
                            buttonOnClick={(e)=>navigateToMakeup("eyebrow")}

                            imgCard="http://makeup-api.herokuapp.com/assets/blush-ff7992c3d7690d18a9b0224177cfbdedbc036497cf87c393ec01c6a2ef070258.svg"
                    description=" ciao bella io fumo cannella"/>

                </div>
            </div>
        </div>
    )
}

export default Home;
